const AddUser = () =>{
   const submitHandler = (event) =>{
        event.preventDefault()
    }

  return ( 
    <>
    <form onSubmit={submitHandler}>
        <label>Username</label>
        <input id ="username" type="text" />

        <label>Age</label>
        <input id ="age" type="number" />

        <button type="submit">Add User</button>
    </form>
    </>
  )
}

export default AddUser
